//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "../data/RouterData.sol";
import "../../../Interface/IFactory.sol";
import "../../../Interface/ISettings.sol";
import "../../../Interface/IVault.sol";
import "../Interface/IAuction.sol";

import {InitializedProxy} from "../../../InitializedProxy.sol";
import "@openzeppelin/contracts-upgradeable/utils/StorageSlotUpgradeable.sol";

contract Router is RouterData{
    
    // ----------------  IMMUTABLE  ---------------
    string public constant name = "Istanbul";

    uint16 public constant versions = 10; // 10 / 10

    address public immutable veTokenTemplate; 

    address public immutable vaultTemplate; 

    address public immutable auctionTemplate; 

    address public immutable voteTemplate; 

    
    /// @notice An event emitted when someone cashes in ERC20 tokens for ETH from an ERC721 token sale
    event Initialize(address curator, address vault); 

    event Cash(address indexed owner, uint256 shares); 

    event CuratorDeposit(address[]  _nft, uint256[] _nftId,uint256[] _amount); 

    event Issue(uint256 _supply,uint256 _reserveRatio, uint256 _EntireVaultPrice,address _vetoken,address _auction,address _vote); 
    

    constructor(address _veTokenTemplate , address _vaultTemplate , address _auctionTemplate , address _voteTemplate) { 
        veTokenTemplate = _veTokenTemplate; 
        vaultTemplate = _vaultTemplate;
        auctionTemplate = _auctionTemplate;
        voteTemplate = _voteTemplate;

    }

    function initialize(address _curator,address _settings,string memory _name,string memory _symbol) external {
        require(!initializer,"initialize :: Already initialized");
        initializer = !initializer;
        Factory = msg.sender;

        vault = mintVault(_name,_symbol);
        setWhiteList(vault, true);

        setWhiteList(address(this), true);
        curator = _curator;
        settings = _settings;
        emit Initialize(curator,vault);
    }

    function curatorDeposit(address[] memory _nft,uint256[] memory _nftId,uint256[] memory _amount) external {
        require(open == false, "curatorDeposit :: Token is already active");
        require(msg.sender == curator, "curatorDeposit :: Only curator can deposit NFT");
        IVault(vault).depositNFTAsset(_nft,_nftId,_amount,msg.sender);
        emit CuratorDeposit(_nft,_nftId,_amount);
    }
    /// @notice a function that locks NFT collateral and issues the Tokens to the issuer 
    function issue(uint256 _supply , uint256 _reserveRatio , uint256 _EntireVaultPrice) external {
        require(msg.sender == curator, "issue :: Only curator can issue the tokens");
        require(open == false, "issue :: Token is already active");
        require(_supply >= 10000*(10**18), "issue :: The supply must be greater than 1000");
        require(_reserveRatio <= 99, "issue :: Incorrect reserve ratio");
        open = true;

        mintContract();

        lastClaimed = block.timestamp;
        fee = 0;

        reserveRatio = _reserveRatio;

        _mintToScale(_supply,curator);

        IAuction(auction).setPrice(_EntireVaultPrice);
        emit Issue( _supply , reserveRatio , _EntireVaultPrice , veToken , auction , vote );
    }


    function mintContract() private {
        veToken = mintVeToken();
        setWhiteList(veToken, true);

        auction = mintAuction();
        setWhiteList(auction, true);

        vote = mintVote();
        setWhiteList(vote, true);
        
    }

    
    function mintToScale(uint256 _supply ,address _mintTo) public onlyWhiteList{
        _mintToScale(_supply,_mintTo);
    }

    function _mintToScale(uint256 _supply ,address _mintTo) private {
        supply += _supply;

        uint256 _govAmount = _supply / 100;
        uint256 _reserveAmount = _supply * reserveRatio / 100;
        uint256 _targetAmount = _supply - _govAmount - _reserveAmount;

        reserveAmount += _reserveAmount;
        address govAddress = ISettings(settings).feeReceiver();
        IVault(vault).mintDivision(govAddress,_govAmount);
        IVault(vault).mintDivision(_mintTo,_targetAmount);
    }

    function claimFees() external {
        require(IVault(vault).getEntireVaultState() != State.NftState.leave, "claim :: cannot claim after auction ends");
        require(open, "claim :: Token not already active");
        // get how much in fees the curator would make in a year
        uint256 currentAnnualFee = fee * IVault(vault).totalSupply() / 1000;
        // get how much that is per second;
        uint256 feePerSecond = currentAnnualFee / 31536000;
        // get how many seconds they are eligible to claim
        uint256 sinceLastClaim = block.timestamp - lastClaimed;
        // get the amount of tokens to mint
        uint256 curatorMint = sinceLastClaim * feePerSecond;

        lastClaimed = block.timestamp;

        IVault(vault).mintDivision(curator, curatorMint); 
    }



    /// @notice an external function to burn ERC20 tokens to receive ETH from ERC721 token purchase
    // function cash() external {
    //     require(auctionState == State.ended, "cash:vault not closed yet");
    //     uint256 bal = balanceOf(msg.sender);
    //     require(bal > 0, "cash:no tokens to cash out");
    //     uint256 share = bal * address(this).balance / totalSupply();
    //     _burn(msg.sender, bal);
    //     _sendETHOrWETH(payable(msg.sender), share);
    //     emit Cash(owner, shares); 
    // }

    // -------------------------------    create contract    -------------------------------
    function mintVeToken() private returns(address) {
        bytes memory _initializationCalldata = abi.encodeWithSignature(
            "initialize(address)",
            vault
        );

        return address(
            new InitializedProxy(
                veTokenTemplate,
                _initializationCalldata
            )
        );
    }

    function mintVault(string memory _name,string memory _symbol) private returns(address){
        bytes memory _initializationCalldata = abi.encodeWithSignature(
            "initialize(string,string)",
            _name,
            _symbol
        );

        return address(
            new InitializedProxy(
                vaultTemplate,
                _initializationCalldata
            )
        );
    } 

    function mintAuction() private returns(address){
        bytes memory _initializationCalldata = abi.encodeWithSignature(
            "initialize()"
        );

        return address(
            new InitializedProxy(
                auctionTemplate,
                _initializationCalldata
            )
        );
    } 

    function mintVote() private returns(address){
        bytes memory _initializationCalldata = abi.encodeWithSignature(
            "initialize()"
        );

        return address(
            new InitializedProxy(
                voteTemplate,
                _initializationCalldata
            )
        );
    } 
    // p1 升级模板  
    function updateRouter(address _updataTemplate) external onlyWhiteList {
        require(IFactory(Factory).routerTemplateMap(_updataTemplate),"updateRouter :: Incorrect template");

        (bool _ok, bytes memory returnData) = _updataTemplate.delegatecall(abi.encodeWithSignature(
            "updateRouterUtils()"
        ));

        require(_ok, string(returnData));
    }
  


    function setWhiteList(address _whiteList,bool _bool) private {
        whiteList[_whiteList] = _bool;
    }

    modifier onlyWhiteList() {
        require(whiteList[msg.sender],"whiteList :: Address check error");
        _;
    }
}

